import React from 'react';
import ReactDOM from 'react-dom/client';
import Mercedes from './Car.js';


const root = ReactDOM.createRoot(document.getElementById('root'));

function Car(props)
{
  <h1>I am a {props.brand}</h1>
}

function Garage()
{
  return (
    <>    
    <h1>What is standing in my garage!</h1>
    <Car brand = {"BMW"}/>
    </>

  )
}


const element = Garage();

root.render(element);
